type AlertTypesType = {
  [key: string]: string,
};

const ALERT_TYPES: AlertTypesType = {
  INFO: 'INFO',
  SUCCESS: 'SUCCESS',
  WARNING: 'WARNING',
  DANGER: 'DANGER',
};

export default ALERT_TYPES;

export type { AlertTypesType };
